import React from "react"
import Heading from "./Heading.jsx"
import Footer from "./Footer.jsx"
import Note from "./Note"
import notes from "../notes"

function App() {
    return (
    <div>
    <Heading />
    <Note title = {notes[0].title} content = {notes[0].content} />
    <Footer />
    </div>
    );
};

export default App;
